import React from "react";
import Moment from "react-moment";

const ProfileEducation = ({
  education: {
    school,
    degree,
    field_of_study,
    current,
    to_date,
    from_date,
    description
  }
}) => {
  return (
    <div className="bg-white p-4 rounded-lg shadow-md mb-4">
      <h3 className="text-xl font-semibold text-gray-800 mb-2">{school}</h3>
      <p className="text-gray-600 mb-2">
        <Moment format="YYYY/MM/DD">{from_date}</Moment> -{" "}
        {!to_date ? "Now" : <Moment format="YYYY/MM/DD">{to_date}</Moment>}
      </p>
      <p className="text-gray-700 mb-2">
        <strong className="font-medium">Degree: </strong>
        {degree}
      </p>
      <p className="text-gray-700 mb-2">
        <strong className="font-medium">Field Of Study: </strong>
        {field_of_study}
      </p>
      {description && (
        <p className="text-gray-700">
          <strong className="font-medium">Description: </strong>
          {description}
        </p>
      )}
    </div>
  );
};

export default ProfileEducation;
